import { Link } from "react-router-dom";
import {FaFacebook, FaTwitterSquare} from 'react-icons/fa'

function Social() {
    return (  <div className='social'>
        <ul>
            <li><Link to='#'><FaFacebook /></Link></li>
            <li><Link to='#'><FaTwitterSquare /></Link></li>
        </ul>
    </div>);
}

export default Social;
